import{_ as e,o as i,c as t,a as r}from"./app.4684b012.js";const f=JSON.parse('{"title":"Vue3 组件库 Fighting Design 欢迎加入","description":"","frontmatter":{},"headers":[{"level":2,"title":"👋 Hello","slug":"👋-hello","link":"#👋-hello","children":[]},{"level":2,"title":"🍀 关于","slug":"🍀-关于","link":"#🍀-关于","children":[]},{"level":2,"title":"🥕 欢迎加入","slug":"🥕-欢迎加入","link":"#🥕-欢迎加入","children":[]},{"level":2,"title":"🚀 加入有什么要求？","slug":"🚀-加入有什么要求","link":"#🚀-加入有什么要求","children":[]},{"level":2,"title":"🎉 相关链接","slug":"🎉-相关链接","link":"#🎉-相关链接","children":[]},{"level":2,"title":"🏆 联系我","slug":"🏆-联系我","link":"#🏆-联系我","children":[]}],"relativePath":"article/article/19.md"}'),a={name:"article/article/19.md"},h=r('<h1 id="vue3-组件库-fighting-design-欢迎加入" tabindex="-1">Vue3 组件库 Fighting Design 欢迎加入 <a class="header-anchor" href="#vue3-组件库-fighting-design-欢迎加入" aria-hidden="true">#</a></h1><h2 id="👋-hello" tabindex="-1">👋 Hello <a class="header-anchor" href="#👋-hello" aria-hidden="true">#</a></h2><p>大家好，我是<a href="https://github.com/Tyh2001" target="_blank" rel="noreferrer">田同学</a>，大家可以加我微信 <code>VirgoTyh</code> 一起共同学习。</p><h2 id="🍀-关于" tabindex="-1">🍀 关于 <a class="header-anchor" href="#🍀-关于" aria-hidden="true">#</a></h2><p><a href="https://github.com/FightingDesign/fighting-design" target="_blank" rel="noreferrer">Fighting Design</a> 是一款基于 <code>vue3</code> 的桌面端组件库，可在 <code>vue3</code> 应用程序中快速构建交互界面。</p><h2 id="🥕-欢迎加入" tabindex="-1">🥕 欢迎加入 <a class="header-anchor" href="#🥕-欢迎加入" aria-hidden="true">#</a></h2><p>通过 <a href="https://github.com/FightingDesign/fighting-design/commits/master" target="_blank" rel="noreferrer">commit</a> 记录可以看出，基本上 <code>95%</code> 以上都是我一个人在输出，每天高频的提交更新，当然靠我自己一个人的力量，还是远远不够的，所以还需要热爱开源的同学一起加入开发，才能让 <code>Fighting Design</code> 越来越好。</p><p>后续还会有很多需要做的方面，如：新组件、现有组件优化、构建优化、样式规范化、类名规范化、模块抽离、其它周边等。</p><h2 id="🚀-加入有什么要求" tabindex="-1">🚀 加入有什么要求？ <a class="header-anchor" href="#🚀-加入有什么要求" aria-hidden="true">#</a></h2><p>只要有一个热爱开源的你即可加入！</p><p>在这里，你可以参与组件开发、样式开发、文档编写、构建优化、单元测试、改错别字，都没有问题。</p><p>如果之前你并没有提交过 <code>PR</code>，可以看我这篇文章来学习下：<a href="https://juejin.cn/post/7108740596738719751" target="_blank" rel="noreferrer">Github 如何提交 PR？</a></p><h2 id="🎉-相关链接" tabindex="-1">🎉 相关链接 <a class="header-anchor" href="#🎉-相关链接" aria-hidden="true">#</a></h2><ul><li><a href="https://github.com/FightingDesign/fighting-design" target="_blank" rel="noreferrer">Github 官方仓库</a></li><li><a href="https://fighting.tianyuhao.cn/" target="_blank" rel="noreferrer">官方文档</a></li><li><a href="https://github.com/FightingDesign/fighting-design/blob/master/CONTRIBUTING.md" target="_blank" rel="noreferrer">贡献指南</a></li></ul><h2 id="🏆-联系我" tabindex="-1">🏆 联系我 <a class="header-anchor" href="#🏆-联系我" aria-hidden="true">#</a></h2><p>添加微信请备注 <code>Github</code> 用户名，加好友邀请进群</p><ul><li>微信：<code>VirgoTyh</code></li><li>Github: <code>https://github.com/Tyh2001</code></li></ul>',17),n=[h];function l(d,o,c,s,g,u){return i(),t("div",null,n)}const _=e(a,[["render",l]]);export{f as __pageData,_ as default};
